import styles from './Header.module.css';
import mealjpg from '../assets/meals.jpg'

function Header() {
    return (
      <>
      <header class={styles.header}>
          <h1>ReactMeal</h1>
          <button>Cart</button>
      </header>
      <div>
          <img src={mealjpg}></img>
      </div>
      </>
    );
  }
  
  export default Header;
